-- --------------------------------------------------
-- 1) Tabla de calidad
-- --------------------------------------------------
CREATE TABLE quality (
    id_quality   INTEGER PRIMARY KEY,
    quality      VARCHAR(255)
);

-- --------------------------------------------------
-- 2) Tabla de vinos (n√≥tese que las columnas llevan espacios)
-- --------------------------------------------------
CREATE TABLE "winequality-red" (
    "id_winequality"        INTEGER PRIMARY KEY,
    "fixed_acidity"         REAL,
    "volatile_acidity"      REAL,
    "citric_acid"           REAL,
    "residual_sugar"        REAL,
    "chlorides"             REAL,
    "free_sulfur_dioxide"   REAL,
    "total_sulfur_dioxide"  REAL,
    "density"               REAL,
    "pH"                    REAL,
    "sulphates"             REAL,
    "alcohol"               REAL,
    "id_quality"            INTEGER,
    FOREIGN KEY("id_quality") REFERENCES quality("id_quality")
);


